sources.styles/blocks/aboutUs.scss:
.aboutUs {
  margin-top: 110px;
  @include onTablet{
    margin-top: 140px;
  }
  @include onDesktop {
    margin-top: 170px;
  }

  &__content {
    display: flex;
    gap: 110px;
    flex-direction: column;
    @include onTablet{
      gap: 140px;
    }
  }

  &__wrapper {
    display: flex;
    flex-direction: column;
    @include onTablet{
      position: relative;
      flex-direction: row;
      &--reverse {
        flex-direction: row-reverse;
      }
    }
  }

  &__top {
    display: flex;
    flex-direction: column-reverse;
    flex: 0 0 auto;
    @include onTablet {
      flex-direction: row;
      gap: 20px;
    }
  }

  &__img {
    width: 100%;
    height: 210px;
    object-fit: cover;
    margin-top: 30px;
    @include onTablet {
      width: $width-img--tablet;
      height: 415px;
    }
    @include onDesktop {
      width: 534px;
      height: 388px;
    }
  }

  &__title {
    font-size: 30px;
    font-weight: 700;
    line-height: 40px;
    color: $dark-grey;
    margin-top: 20px;
    @include onTablet {
      font-size: 36px;
      line-height: 46px;
      &--right {
        position: absolute;
        left: calc(#{$width-img--tablet} + 20px);
        width: 280px;
      }
      &--left {
        position: absolute;
        left: 0;
        width: 280px;
      }
    }
    @include onDesktop {
      font-size: 56px;
      line-height: 70px;
      width: 582px;
      &--right {
        position: absolute;
        left: calc(534px + 20px);
      }
      &--left {
        position: absolute;
        left: 0;
      }
    }
  }

  &__addInf {
    font-size: 12px;
    font-weight: 700;
    line-height: 14px;
    color:#0db2b3;
    margin-top: 30px;
    position: relative;
    @include onTablet {
      margin-top: 60px;
    }

    &::after {
      content: '';
      height: 1px;
      width: 53px;
      background-color: #0db2b3;
      position: absolute;
      top: 25px;
      left: 0;
    }
  }

  &__subtitle {
    font-size: 14px;
    font-weight: 400;
    line-height: 21px;
    color: $gray;
    margin-top: 20px;
    @include onTablet {
      font-size: 16px;
      line-height: 24px;
    }
    @include onDesktop {
      margin-top: 70px;
    }
  }

  &__text {
    display: flex;
    flex-direction: column;

    @include onTablet {
      flex: 1;
      margin-left: 20px;
      margin-top: 122px;
      &--reverse {
        margin-left: 0;
        margin-right: 20px;
      }

    }
  }
}
